import React, {useState, useEffect} from 'react';
import './about.css';

function About() {
    return (
        <section id="about" className='about'>
          <div className="container-fluid">
              <div className="row">
                  <h4 className="section-title">About</h4>
              </div>
              <div className="col-sm-6 col-md-4"> </div>
          </div>
        </section> 
      );
}

export default About;
